metadata:
  annotations:
    alm-examples: |-
      [
        {
          "apiVersion": "jaegertracing.io/v1",
          "kind": "Jaeger",
          "metadata": {
            "name": "jaeger-all-in-one-inmemory"
          }
        },
        {
          "apiVersion": "jaegertracing.io/v1",
          "kind": "Jaeger",
          "metadata": {
            "name": "jaeger-all-in-one-local-storage"
          },
          "spec": {
            "storage": {
              "options": {
                "badger": {
                  "directory-key": "/badger/key",
                  "directory-value": "/badger/data",
                  "ephemeral": false
                }
              },
              "type": "badger",
              "volumeMounts": [
                {
                  "mountPath": "/badger",
                  "name": "data"
                }
              ],
              "volumes": [
                {
                  "emptyDir": {},
                  "name": "data"
                }
              ]
            }
          }
        },
        {
          "apiVersion": "jaegertracing.io/v1",
          "kind": "Jaeger",
          "metadata": {
            "name": "jaeger-prod-elasticsearch"
          },
          "spec": {
            "storage": {
              "options": {
                "es": {
                  "server-urls": "http://elasticsearch.default.svc:9200"
                }
              },
              "type": "elasticsearch"
            },
            "strategy": "production"
          }
        }
      ]
